import { Link } from 'react-router-dom';

export default function Landing() {
  return (
    <div className="flex-1 flex flex-col items-center justify-center px-4">
      <h1 className="text-4xl font-extrabold text-green-900 mb-6">Welcome to AGRISOKO</h1>
      <p className="text-lg text-gray-700 mb-8 max-w-xl text-center">
        Connecting farmers and buyers across Kenya. Post your produce, browse listings,
        and let us handle the rest.
      </p>
      <div className="space-x-4">
        <Link to="/seller" className="px-6 py-3 bg-green-700 text-white rounded-lg hover:bg-green-600">
          Sell Now
        </Link>
        <Link to="/buyer" className="px-6 py-3 bg-white text-green-700 border border-green-700 rounded-lg hover:bg-green-50">
          Browse Produce
        </Link>
      </div>
    </div>
  );
}
